(clojure.core/defn create-dhcp-options "Creates a set of DHCP options for your VPC. After creating the set, you must\nassociate it with the VPC, causing all existing and new instances that you\nlaunch in the VPC to use this set of DHCP options. The following are the\nindividual DHCP options you can specify. For more information about the options,\nsee RFC 2132 (http://www.ietf.org/rfc/rfc2132.txt).\n * domain-name-servers - The IP addresses of up to four domain name servers, or\nAmazonProvidedDNS. The default DHCP option set specifies AmazonProvidedDNS. If\nspecifying more than one domain name server, specify the IP addresses in a\nsingle parameter, separated by commas. If you want your instance to receive a\ncustom DNS hostname as specified in domain-name, you must set\ndomain-name-servers to a custom DNS server.\n * domain-name - If you're using AmazonProvidedDNS in \"us-east-1\", specify\n\"ec2.internal\". If you're using AmazonProvidedDNS in another region, specify\n\"region.compute.internal\" (for example, \"ap-northeast-1.compute.internal\").\nOtherwise, specify a domain name (for example, \"MyCompany.com\"). This value is\nused to complete unqualified DNS hostnames. Important: Some Linux operating\nsystems accept multiple domain names separated by spaces. However, Windows and\nother Linux operating systems treat the value as a single domain, which results\nin unexpected behavior. If your DHCP options set is associated with a VPC that\nhas instances with multiple operating systems, specify only one domain name.\n * ntp-servers - The IP addresses of up to four Network Time Protocol (NTP)\nservers.\n * netbios-name-servers - The IP addresses of up to four NetBIOS name servers.\n * netbios-node-type - The NetBIOS node type (1, 2, 4, or 8). We recommend that\nyou specify 2 (broadcast and multicast are not currently supported). For more\ninformation about these node types, see RFC 2132\n(http://www.ietf.org/rfc/rfc2132.txt).\n Your VPC automatically starts out with a set of DHCP options that includes only\na DNS server that we provide (AmazonProvidedDNS). If you create a set of\noptions, and if your VPC has an Internet gateway, make sure to set the\ndomain-name-servers option either to AmazonProvidedDNS or to a domain name\nserver of your choice. For more information about DHCP options, see DHCP Options\nSets\n(http://docs.aws.amazon.com/AmazonVPC/latest/UserGuide/VPC_DHCP_Options.html) in\nthe Amazon Virtual Private Cloud User Guide." ([create-dhcp-options-requestinput] (clojure.core/let [request-function-result__22119__auto__ (req-create-dhcp-options-request create-dhcp-options-requestinput)] (portkey.aws/-call-http (clojure.core/into request-function-result__22119__auto__ {:http.request.configuration/endpoints portkey.aws.ec2.-2016-04-01/endpoints, :http.request.configuration/target-prefix nil, :http.request.spec/output-spec :portkey.aws.ec2.-2016-04-01/create-dhcp-options-result, :http.request.configuration/mime-type {"content-type" "application/x-www-form-urlencoded; charset=utf-8"}, :http.request.configuration/request-uri "/", :http.request.configuration/version "2016-04-01", :http.request.configuration/service-id nil, :http.request.spec/input-spec :portkey.aws.ec2.-2016-04-01/create-dhcp-options-request, :http.request.configuration/protocol "ec2", :http.request.configuration/method :post, :http.request.configuration/response-code nil, :http.request.configuration/result-wrapper nil, :http.request.configuration/action "CreateDhcpOptions", :http.request.configuration/output-deser-fn response-create-dhcp-options-result, :http.request.spec/error-spec {}})))))
